import React, { Fragment, useState } from 'react'; 
import HeaderFoto from '../resources/Header-foto.jpg'
import Buscador from './Buscador';
const Header = ({imagenes, setImagenes, seleccionarVista}) => {
    return ( 
        <Fragment>
            <nav className="nav-bar">
                <a isActive={vista === 'Home'} onClick={() => seleccionarVista('Home')} className="titulo-nav-bar" href="#">Lenspire</a>
                <a isActive={vista === 'Favoritos'} onClick={() => seleccionarVista('Favoritos')} className="favoritos" href="#">Favoritos</a>
            </nav>
            <div>
                <img className='imagen-grande' key="header-img" src={HeaderFoto}></img>
                <div className='titulo'>
                    Lenspire
                </div>
                <Buscador
                    setImagenes={setImagenes}
                    />
            </div>
        </Fragment>
     );
}
 
export default Header;
